import unittest
from pop3 import POP3


class MyTestCase(unittest.TestCase):
    def test_pop3(self):
        pop = POP3(host="pop.qip.ru",
                   ssl=False)
        self.assertEqual(pop.first_message, "+OK POP3 server")
        self.assertEqual(pop.cmd_user("test.pop3@qip.ru"), (True, '+OK'))
        self.assertEqual(pop.cmd_pass("1234qwer"), (True, '+OK'))
        self.assertEqual(pop.cmd_stat(), (True, '+OK 2 4806'))
        self.assertEqual(pop.cmd_list(), (True, '1 2631\n2 2175\n'))
        self.assertEqual(pop.cmd_list(1), (True, '1 2631'))
        self.assertEqual(pop.cmd_noop(), (True, '+OK'))
        self.assertEqual(pop.cmd_top(1, 0), top_pop)
        self.assertEqual(pop.cmd_retr(1), retr_pop)
        self.assertEqual(pop.cmd_rset(), (False, '-ERR not implemented'))
        self.assertEqual(pop.cmd_quit(), (True, '+OK'))

    def test_pop3_ssl(self):
        pop = POP3(host="pop.mail.ru")
        self.assertEqual(pop.first_message, "+OK")
        self.assertEqual(pop.cmd_user("test.pop3@inbox.ru"), (True, '+OK'))
        self.assertEqual(pop.cmd_pass("1234qwer"), (True, '+OK Welcome!'))
        self.assertEqual(pop.cmd_stat(), (True, '+OK 3 692272'))
        self.assertEqual(pop.cmd_list(), (True, '1 161309\n'
                                                '2 351046\n'
                                                '3 179917\n'))
        self.assertEqual(pop.cmd_list(1), (True, '1 161309'))
        self.assertEqual(pop.cmd_noop(), (True, '+OK '))
        self.assertEqual(pop.cmd_top(1, 0), top_pop_ssl)
        self.assertEqual(pop.cmd_retr(1), retr_pop_ssl)
        self.assertEqual(pop.cmd_dele(2), (True, "+OK message 2 deleted"))
        self.assertEqual(pop.cmd_rset(),
                         (True, '+OK maildrop has 3 messages (692272 octets)'))
        self.assertEqual(pop.cmd_quit(),
                         (True, '+OK POP3 server at inbox.ru signing off'))

